import "./Movie.css";
export default function Movie({
  movieName,
  movieOverview,
  movieRating,
  movieReleaseDate,
  moviePoster,
}) {
  return (
    <div className="movie">
      <p>{movieName}</p>
      <img src={`https://image.tmdb.org/t/p/w200/${moviePoster}`}></img>
      <p>{movieOverview}</p>
      <p>{movieRating}</p>
      <p>{movieReleaseDate}</p>
    </div>
  );
}
